import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useParams, useNavigate } from 'react-router-dom';
import Rating from './Rating';
import { useCartdata } from '../components/Context';
import Loading from '../components/Loading';

export default function Singleproduct() {
    const navigate = useNavigate();
    const [product, setproduct] = useState();
    const { cart, dispatch } = useCartdata();
    const [load, setload] = useState(false);
    const [loading, setloading] = useState(true);
    const { id } = useParams();
    function reducefunction(total, value, index, array) {
        const totalrat = total + value;
        return totalrat;
    }
    const addtocart = (product) => {
        dispatch({ type: 'addtocart', payload: product });
        return navigate('/cart');
    }
    useEffect(() => {
        setload(true);
        axios.get(`https://backend-ffkf.onrender.com/api/products/${id}`).then(
            res => {
                setproduct(res.data);
                setloading(false);
                setload(false);
            }
        );
    }, []);
    if (load) {
        return <Loading />
    }
    return (
        <div className='singleproduct'>
            {!loading && <div className="productdetails">
                <div className="singwrap">
                    <div className="productimg">
                        <img src={product.image} alt="productimage" width={250} height={350} />
                    </div>
                    <div className="productdata">
                        <h2 className="productname proalldata">{product.title}</h2>
                        <div className="productprice proalldata">Price: ${product.price}</div>
                        <div className="rating proalldata">{product.ratings.length === 0 && <img src='data:image/png;base64,' alt='0 stars' width={90} height={25} />}</div>
                        <div className="rating proalldata">{product.ratings.length > 0 && Math.floor(product.ratings.reduce(reducefunction) / product.ratings.length) === 5 && <img src='data:image/png;base64,' alt='5 stars' width={90} height={25} />}</div>
                        <div className="rating proalldata">{product.ratings.length > 0 && Math.floor(product.ratings.reduce(reducefunction) / product.ratings.length) === 4 && <img src='data:image/png;base64,' alt='4 stars' width={90} height={25} />}</div>
                        <div className="rating proalldata">{product.ratings.length > 0 && Math.floor(product.ratings.reduce(reducefunction) / product.ratings.length) === 3 && <img src='data:image/png;base64,' alt='3 stars' width={90} height={25} />}</div>
                        <div className="rating proalldata">{product.ratings.length > 0 && Math.floor(product.ratings.reduce(reducefunction) / product.ratings.length) === 2 && <img src='data:image/png;base64,' alt='2 stars' width={90} height={25} />}</div>
                        <div className="rating proalldata">{product.ratings.length > 0 && Math.floor(product.ratings.reduce(reducefunction) / product.ratings.length) === 1 && <img src='data:image/png;base64,' alt='1 stars' width={90} height={25} />}</div>
                        <div className="norating">{product.ratings.length} ratings</div>
                        <div className="productdesc proalldata">{product.description}</div>
                    </div>
                    <div className="productsummery">
                        <div className="productseldiv"><span className="seller">seller</span><br /><h2 className='prodselnam'>{product.sellername}</h2></div>
                        <div className="productsumpri">price:    ${product.price}</div>
                        <div className="productstock">status:    instock</div>
                        <div className="addcartbtn"><button className='addcart' onClick={() => addtocart(product)}>Add to Cart</button></div>
                    </div>
                </div>
                <Rating rating={product.rating} productid={product._id} />
            </div>}
        </div>
    )
}
